import React from 'react';
import { Link } from 'react-router-dom';
import '../styles/HomePage.css';

function HomePage() {
  return (
    <div className="home-page">
      {/* Hero Section */}
      <section className="hero">
        <div className="hero-content">
          <h1>Find Your Dream Home</h1>
          <p>Discover premium properties in the most desirable locations</p>
          <Link to="/properties" className="cta-button">Browse Properties</Link>
        </div>
      </section>

      {/* Featured Properties */}
      <section className="featured-section">
        <h2>Featured Listings</h2>
        <div className="property-grid">
          <div className="property-card">
            <div className="property-image" style={{backgroundImage: "url('https://images.unsplash.com/photo-1564013799919-ab600027ffc6')"}}></div>
            <div className="property-details">
              <h3>Luxury Villa</h3>
              <p>$1,200,000</p>
              <p>Malibu, CA</p>
            </div>
          </div>
          {/* Additional property cards would go here */}
        </div>
      </section>

      {/* Call to Action */}
      <section className="cta-section">
        <h2>Ready to find your perfect home?</h2>
        <Link to="/properties" className="cta-button">View All Properties</Link>
      </section>
    </div>
  );
}

export default HomePage;
